import React from 'react'

class FirstTabs extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                {
                    this.props.tabList.map((plac,inde))
            }

                {this.props.tabList.icon}<span>{this.props.tabList.user}</span>
                <p>{this.props.tabList.number}</p>
                {this.props.type}
                <span>{this.props.upOrDown}</span><span>{this.props.howMany}</span>
            </div>
        )
    }

}

export default FirstTabs
